import style from "./Courses.module.css";

function coursesMenu(props) {
  return (
    <div className={style.container}>
      <div>
        {props.state.courses.courses.map((p) => (
          <div key={p.id}>
            <div>{props.state.courses.courses.courseName}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
export default coursesMenu;
